import heritageSitesImage from '../images/heritagesites.jpg'; // Adjust the image path as needed

const HeritageSites = () => {
    const location = useLocation();
    const username = location.state?.username || 'Guest';
    console.log('hello' + username); // Add a semicolon at the end of the console.log statement
    return (
        <div>
            {/* <h2>Welcome, {username}!</h2> */}
            {/* other content of the home page*/}
            <center>
                <h1>Few heritage sites of India!!</h1>
                <img src={heritageSitesImage} alt="Heritage Sites" width="1000" height="1200" /> {/* Adjust image attributes as needed */}
            </center>
        </div>
    );
};

export default HeritageSites;
